import './App.css';
import Footer from './components/Footer';
import Header from './components/Header';
import Main from './components/Main';
import Service from './components/Service';

function App() {
  return (
    <>
      <Header/>
      <Main/>
      <Service/>
      <Footer/>
    </>
  );
}

export default App;
